  const fetchPersonalData = async () => {
    try {
      const response = await axios.get('/auth/personal1'); // Adjust the endpoint as needed
      setPersonalData(response.data.data);
    } catch (err) {
      setError(err.message);
    }
  };

  // Function to delete a personal data item
  const deletePersonalItem = async () => {
    try {
      await axios.delete(`/auth/personal1/${deleteId}`); // Adjust the endpoint as needed
      fetchPersonalData(); // Refresh the data after deletion
      setDeleteId(''); // Clear the input field after deletion
